import React from 'react';
import {board} from '../../data/board'
import Baner from './Baner/Baner';
import Board from './Board/Board';


const GameWrapper = () => (
    <div>
        <Baner />
        <Board 
            description = {board[0].description}
        />
    </div>
);

export default GameWrapper;
